const fs = require('fs');
const path = require('path');

function init() {
  return new Promise((resolve, reject) => {
    const svgs = []
    JD_ICON.forEach(icon =>{
      const svg = '\''+icon.name+'\':\''+icon.content.replace('fill=\"#737382\"','')+'\'';
      svgs.push(svg)
    })

    const content = 'const icons = {'+svgs.join(',')+'}';



    const dirPath = path.join(__dirname, `../src/icon/tmp/`);
    const filePath = path.join(dirPath, `svg.js`);
    if (!fs.existsSync(dirPath)) {
      fs.mkdirSync(dirPath);
    }
    fs.writeFile(filePath, content, err => {
      if (err) throw err;
      resolve(`生成index.js文件成功`);
    });
  });
}

init()
